// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract ArrayReversal {

    // Array to store integers
    int[] public array;

    // Function to add an element to the array (for testing)
    function addElement(int element) public {
        array.push(element);
    }

    // Function to reverse the array
    function reverseArray() public {
        uint start = 0;
        uint end = array.length - 1;

        // Loop to swap the elements
        while (start < end) {
            // Swap elements at positions `start` and `end`
            int temp = array[start];
            array[start] = array[end];
            array[end] = temp;

            // Move the indices closer
            start++;
            end--;
        }
    }

    // Function to get the current array (for testing)
    function getArray() public view returns (int[] memory) {
        return array;
    }
}

